Ticker _ticker;

int _lastFrame    = sizeof(video_data) / sizeof(video_data[0]);

PxMATRIX* _matrixDisplay = NULL;
volatile int _currentFrame = 0;
volatile bool _done = false;

void drawNextFrame() {
    Helper::decode_frame(&video_data[_currentFrame], *_matrixDisplay);

    _currentFrame++;

    if(_currentFrame >= _lastFrame) {
        _ticker.detach();
        _matrixDisplay = NULL;
        _done = true;
    }
}

void start_playback(PxMATRIX* matrixDisplay) {
    _matrixDisplay = matrixDisplay;
    _done          = false;
    _currentFrame  = 0;

    _ticker.attach_ms(250, drawNextFrame);
}

bool is_playback_done() {
    return _done;
}
